    <style type="text/css">
        body, html {
            height: 100%;
        }

        body {
            margin: 0;
            background-color: #f7f4f3;
            font-size: 1rem;
            font-weight: 400;
            line-height: 1.5
        }

        .app-loading {
            position: relative;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            height: 100%;
            width: 100%;
        }

        img {
            border-style: none;
            vertical-align: middle;
        }

        .app-loading .spinner {
            height: 200px;
            width: 200px;
            -webkit-animation: svg_rotate 2s linear infinite;
            animation: svg_rotate 2s linear infinite;
            transform-origin: center center;
            position: absolute;
            top: 0;
            bottom: 0;
            left: 0;
            right: 0;
            margin: auto;
        }

            .app-loading .spinner .path {
                stroke-dasharray: 1, 200;
                stroke-width: 1;
                stroke-dashoffset: 0;
                -webkit-animation: svg_dash 1.5s ease-in-out infinite;
                animation: svg_dash 1.5s ease-in-out infinite;
                stroke-linecap: round;
                stroke: #ce0a06;
            }

        @keyframes svg_rotate {
            100% {
                transform: rotate(360deg);
            }
        }

        @-webkit-keyframes svg_rotate {
            100% {
                transform: rotate(360deg);
            }
        }

        @keyframes svg_dash {
            0% {
                stroke-dasharray: 1, 200;
                stroke-dashoffset: 0;
            }

            50% {
                stroke-dasharray: 89, 200;
                stroke-dashoffset: -35px;
            }

            100% {
                stroke-dasharray: 89, 200;
                stroke-dashoffset: -124px;
            }
        }

        @-webkit-keyframes svg_dash {
            0% {
                stroke-dasharray: 1, 200;
                stroke-dashoffset: 0;
            }

            50% {
                stroke-dasharray: 89, 200;
                stroke-dashoffset: -35px;
            }

            100% {
                stroke-dasharray: 89, 200;
                stroke-dashoffset: -124px;
            }
        }
    </style>
